import React from "react";

const UploadCard = (upload) => {
  return (
    <div>
      {console.log(upload.upload.text.title)}
      <ul>
        <li>{upload.upload.text.title}</li>
        <li>{upload.upload.text.link}</li>
      </ul>
    </div>
  );
};

export default UploadCard;
